              if(e.key === "Enter"){
                if(e.currentTarget.value) 
                props.fn(e.currentTarget.value);
              }
            //  console.log("data", e.currentTarget.value);
             
            //  e.currentTarget.value = "";
            }}/>

            {
              props.data.map((el)=>{ 
                return  <img src = {el.images.original.url}  alt="loading.."/>
              })
            }        
         
        </div>
    )
}

export default GifyModel;
